import React, { useEffect, useState } from 'react';
import './App.css'; // import the external CSS
// NOTE: You can rename this file to CallInsights.jsx if you prefer.
//       Below is just an example using "App.jsx" as your main component.

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Fetch the JSON from your Python backend
    fetch('http://localhost:5001/api/output')
      .then((response) => response.json())
      .then((jsonData) => {
        setData(jsonData);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  // Once data is fetched, parse the nested JSON in each key
  // (Each "output" field itself contains a JSON string we need to parse)
  if (!data) {
    return <div>Loading...</div>;
  }

  // 1) Call Summary
  const callSummaryOutput = JSON.parse(data.call_summary.output);
  const summary = callSummaryOutput.summary;
  const rating = callSummaryOutput.rating;

  // 2) Custom RAG Analysis
  const customRagAnalysisOutput = JSON.parse(data.custom_rag_analysis.output);
  const convBalance = customRagAnalysisOutput['Conversational Balance'];
  const objectionHandling = customRagAnalysisOutput['Objection Handling'];
  const pitchOptimization = customRagAnalysisOutput['Pitch Optimization'];
  const callToActionExecution = customRagAnalysisOutput['Call-to-Action Execution'];

  // 3) Buyer Intent
  const buyerIntentOutput = JSON.parse(data.buyer_intent.output);
  const buyerIntentNlp = buyerIntentOutput.nlp;

  // 4) Profanity Check
  const profanityCheckOutput = JSON.parse(data.profanity_check.output);
  const severityLevel = profanityCheckOutput['severity level'];
  const profanityReport = profanityCheckOutput['report'];

  // Simple accordion toggle using vanilla DOM manipulation for demonstration.
  // You could also implement a more "React-y" approach by tracking open/close in state.
  useEffect(() => {
    const accordionHeaders = document.querySelectorAll('.accordion-header');

    accordionHeaders.forEach((header) => {
      header.addEventListener('click', () => {
        header.classList.toggle('active');
        const content = header.nextElementSibling;
        content.classList.toggle('show');
      });
    });

    // Cleanup listeners on unmount
    return () => {
      accordionHeaders.forEach((header) => {
        header.removeEventListener('click', () => {});
      });
    };
  }, []);

  return (
    <div className="container">
      {/* TOP BAR */}
      <div className="top-bar">
        <div className="logo">Call Insights</div>
      </div>

      {/* CONTENT WRAPPER */}
      <div className="content">
        {/* LEFT SIDEBAR */}
        <div className="sidebar">
          <h2>Call Rating</h2>
          <div className="match-rate-circle" data-percentage={rating}>
            {/* Display rating from JSON */}
            <span className="percentage">{rating}%</span>
          </div>

          {/* Buyer Intent Section */}
          <div className="sidebar-section">
            <h4>Buyer Intent</h4>
            <p>
              <strong>Predicted:</strong>{' '}
              <span style={{ color: 'green' }}>
                {buyerIntentNlp /* from JSON */}
              </span>
            </p>
          </div>

          {/* Profanity Detection Section */}
          <div className="sidebar-section">
            <h4>Profanity Detection</h4>
            <p>
              <strong>Severity Level:</strong> {severityLevel}
            </p>
            <p>{profanityReport}</p>
          </div>
        </div>

        {/* MAIN SECTION */}
        <div className="main-section">
          {/* 1. SUMMARY & RATING */}
          <div className="section-card">
            <h3>Call Summary</h3>
            {/* Insert summary from JSON */}
            <p>{summary}</p>
            <h3>Overall Call Score: {rating}/100</h3>
          </div>

          {/* 2. STRENGTHS & AREAS FOR IMPROVEMENT */}
          <div className="section-card">
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '2rem' }}>
              <div style={{ flex: 1 }}>
                <h3>Strengths</h3>
                <ul>
                  <li>
                    <strong>Strong opening:</strong> John's introduction is clear,
                    concise, and relevant to Michael's company.
                  </li>
                  <li>
                    <strong>Good discovery questions:</strong> John asks
                    open-ended questions to understand Michael's current pain points
                    and challenges.
                  </li>
                  <li>
                    <strong>Effective presentation of value:</strong> John clearly
                    explains how CloudSync's solution addresses Michael's concerns
                    and provides specific benefits.
                  </li>
                  <li>
                    <strong>Professional tone and language:</strong> The
                    conversation is polite, friendly, and free of jargon or overly
                    technical terms.
                  </li>
                </ul>
              </div>
              <div style={{ flex: 1 }}>
                <h3>Areas for Improvement</h3>
                <ul>
                  <li>
                    <strong>Lack of depth in discovery:</strong> While John asks good
                    questions, he could have dug deeper to understand Michael's
                    specific needs and goals.
                  </li>
                  <li>
                    <strong>No clear next steps:</strong> Although John schedules a
                    follow-up call, he doesn't explicitly outline what Michael can
                    expect.
                  </li>
                </ul>
              </div>
            </div>
          </div>

          {/* 3. DETAILED ANALYSIS (Accordion) */}
          <div className="section-card">
            <h3>Detailed Analysis</h3>
            <div className="accordion">
              {/* Conversational Balance */}
              <div className="accordion-item">
                <div className="accordion-header">Conversational Balance</div>
                <div className="accordion-content">
                  <p>{convBalance}</p>
                </div>
              </div>

              {/* Objection Handling */}
              <div className="accordion-item">
                <div className="accordion-header">Objection Handling</div>
                <div className="accordion-content">
                  <p>{objectionHandling}</p>
                </div>
              </div>

              {/* Pitch Optimization */}
              <div className="accordion-item">
                <div className="accordion-header">Pitch Optimization</div>
                <div className="accordion-content">
                  <p>{pitchOptimization}</p>
                </div>
              </div>

              {/* Call-to-Action Execution */}
              <div className="accordion-item">
                <div className="accordion-header">Call-to-Action Execution</div>
                <div className="accordion-content">
                  <p>{callToActionExecution}</p>
                </div>
              </div>
            </div>
            <p>
              By implementing these suggestions, you'll be able to create a more
              balanced conversation, handle objections more effectively, and optimize
              your pitch to resonate better with prospects.
            </p>
          </div>

          {/* FOOTER ACTIONS */}
          <div className="footer-actions">
            <button>Generate Follow-Up Email</button>
            <button>Schedule Next Call</button>
            <button>View Transcript</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
